import React from 'react'
import AppBar from '@mui/material/AppBar';
import { IconButton, Toolbar, Typography } from '@mui/material';
const Header = () => {
  return (
    <AppBar>
      <Toolbar>
        <Typography variant='h6' component='s'>Valantis</Typography>
      </Toolbar>
    </AppBar>
  )
}

export default Header
